def get_sol(): return Solution()
class Solution:
    # https://leetcode.com/problems/process-restricted-friend-requests/discuss/1576913/Python-Usual-union-find-explained./1149984
    def friendRequests(self, n: int, restrictions: List[List[int]], requests: List[List[int]]) -> List[bool]:
        restrictions = set([tuple(r) for r in restrictions])
        di = {}
        res = []

        for request in requests:
            from_set = di.get(request[0], {request[0]})
            to_set = di.get(request[1], {request[1]})

            flag=True
            for x in from_set:
                for y in to_set:
                    if (x,y) in restrictions or (y,x) in restrictions:
                        flag=False
                        break
                if not flag: break

            if not flag:
                res.append(False)
            else:
                res.append(True)
                union = from_set.union(to_set)
                for num in union:
                    di[num] = union

        return res
class UnionFind:
    # tle
    def __init__(self,n):
        self.n=n
        self.par=[i for i in range(n)]
        self.size=[1 for _ in range(n)]
    def __repr__(self): return str(self.par)
    def union(self,a,b):
        a=self.find(a)
        b=self.find(b)
        if a!=b:
            if self.size[a]<self.size[b]:
                a,b=b,a
            self.par[b]=a
            self.size[a]+=self.size[b]
    def find(self,a):
        if a!=self.par[a]:
            self.par[a]=self.find(self.par[a])
        return self.par[a]
    def getReps(self,a,b):
        pa=self.find(a)
        pb=self.find(b)
        return sorted([pa,pb])
class Solution:
    def friendRequests(self, n: int, restrictions: List[List[int]], requests: List[List[int]]) -> List[bool]:
        uf=UnionFind(n)
        res=[]
        for a,b in requests:
            reps1=uf.getReps(a,b)
            if reps1[0]==reps1[1]:
                res.append(True)
                continue
            flag=True
            for c,d in restrictions:
                reps2=uf.getReps(c,d)
                if reps1==reps2:
                    flag=False
                    break
            if flag:
                uf.union(a,b)
            res.append(flag)
        return res
